import React, {ReactNode} from "react";
import Icon from '@ant-design/icons';

interface IconProps {
  width?: string;
  height?: string;
  className?: string;
  fill?: string;
  focusable?: string;
  style?: Object;
}

interface SvgProps {
  width?: string;
  height?: string;
  className?: string;
  fill?: string;
  focusable?: string;
  style?: Object;
  viewBox?: string;
  children: ReactNode
}

/**
 *  初始化图标的svg
 *
 */
const InitIcon = (props: SvgProps) => {
  let {width, height, className, fill, style, viewBox}= props;
  viewBox = viewBox ? viewBox : "0 0 1024 1024";
  width = width ? width : '1em';
  height = height ? height : '1em';
  fill = fill ? fill : 'currentColor';
  className = className ? className : '';
  const svg = () => (
    <svg
      width={width}
      height={height}
      fill={fill}
      aria-hidden="true"
      focusable="false"
      style={style}
      className={className}
      viewBox={viewBox}
    >
      {props.children}
    </svg>
  );
  return <Icon component={svg} />
}

